import React from 'react';
import '../styles/footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <p><b>Urban Issue Reporting Platform.</b></p>
      <p>Making cities better, one report at a time.</p>
    </footer>
  );
};

export default Footer;
